import React, { useState } from "react";
import Link from "next/link";


const headingLarge = ({ color = "black" }) => ({
  font: "26px/30px Georgia, serif",
  padding: "0 0 16px 0",
  margin: 0,
  color
});

export const HeadingLarge = createComponent(headingLarge, "h1");

const Navigation = ({ animations }) => (
  <nav>
    <h1>Animation Library </h1>
    <div>
      <button>Animations V</button>
      <div>
        {animations.map(item => (
          <li>
            <Link href={`/${item.animationKey}`}>{item.animationName}</Link>
          </li>
        ))}
      </div>
    </div>
  </nav>
);

export default Navigation;
